import React, { useState } from 'react';

const App = () => {

    const [number, setNumber] = useState(0);
    
    return (
        <>
            <div className='main_div'>
                <h1>{number}</h1>
                <button>Increm</button>
                <button>Decrem</button>
            </div>
        </>
    );

}

export default App;
